import './App.css';
import Header from './components/Header';
import { Route, Routes } from 'react-router-dom';
function App() {
  return (
    <>
      <header>
        <Header />
      </header>
      <main>
      < Routes>
      <Route path='/login' />
      </Routes>
      </main>
    </>
  );
}

export default App;
